# Definition for singly-linked list.
class ListNode(object):
    def __init__(self, x):
        self.val = x
        self.next = None


import collections


class Solution(object):
    def reverseList(self, head):
        """
        :type head: ListNode
        :rtype: ListNode
        """

        if not head or not head.next:
            return head
        pre = head
        head = head.next
        pre.next = None
        while head.next:
            temp = head.next
            head.next = pre
            pre = head
            head = temp
        head.next = pre
        return head

    def minSubArrayLen(self, s, nums):
        """
        :type s: int
        :type nums: List[int]
        :rtype: int
        """

        total = 0
        start = 0
        min_Length = 1000000
        i = 0
        while i <= len(nums):
            if total >= s:
                while total >= s:
                    min_Length = min(min_Length, i - start)
                    total -= nums[start]
                    start += 1
            else:
                if i == len(nums):
                    break
                total += nums[i]
                i += 1
        if min_Length == 1000000:
            return 0
        return min_Length

    def canFinishOld(self, numCourses, prerequisites):
        """
        :type numCourses: int
        :type prerequisites: List[List[int]]
        :rtype: bool
        """

        self.preDic = {}
        for pre in prerequisites:
            if pre[0] not in self.preDic:
                self.preDic[pre[0]] = [pre[1]]
            else:
                self.preDic[pre[0]].append(pre[1])
        for i in range(numCourses):
            if i in self.preDic:
                if not self.checkNumLoop(i, []):
                    return False
        return True

    def checkNumLoop(self, id, memo):
        if id not in self.preDic:
            return True
        memo.append(id)
        for i in self.preDic[id]:
            if i in memo:
                print(i, memo)
                return False
            if not self.checkNumLoop(i, memo):
                return False
        del self.preDic[id]
        return True

    def canFinish(self, numCourses, prerequisites):
        """
        :type numCourses: int
        :type prerequisites: List[List[int]]
        :rtype: bool
        """
        graph = [[] for _ in range(numCourses)]
        degree = [0] * numCourses
        visit = set()
        for p in prerequisites:
            graph[p[1]].append(p[0])
            degree[p[0]] += 1

        queue = collections.deque()

        for i in range(numCourses):
            if degree[i] == 0:
                queue.append(i)

        count = 0
        while queue:
            x = queue.popleft()
            count += 1
            for node in graph[x]:
                degree[node] -= 1
                if degree[node] == 0:
                    queue.append(node)

        return count == numCourses

    def findOrder(self, numCourses, prerequisites):
        """
        :type numCourses: int
        :type prerequisites: List[List[int]]
        :rtype: List[int]
        """
        supDic = {}
        preDic = {}
        Queue = []
        res = []
        if not self.canFinish(numCourses, prerequisites):
            return []
        for sup in prerequisites:
            if sup[1] not in supDic:
                supDic[sup[1]] = [sup[0]]
            else:
                supDic[sup[1]].append(sup[0])
        for pre in prerequisites:
            if pre[0] not in preDic:
                preDic[pre[0]] = [pre[1]]
            else:
                preDic[pre[0]].append(pre[1])
        for i in range(numCourses):
            if i not in preDic:
                Queue.append(i)
        while Queue:
            num = Queue.pop(0)
            res.append(num)
            if num in supDic:
                for supNum in supDic[num]:
                    if supNum in preDic:
                        preDic[supNum].remove(num)
                        if not preDic[supNum]:
                            Queue.append(supNum)
        return res

    class Solution(object):
        def findWords(self, board, words):
            """
            :type board: List[List[str]]
            :type words: List[str]
            :rtype: List[str]
            """
            res = []
            self.board = board
            for word in words:
                for i in range(len(board)):
                    for j in range(len(board[0])):
                        if self.checkWord(word, 0, i, j, []) and word not in res:
                            res.append(word)
            return res

        def checkWord(self, word, pos, i, j, tupleList):
            if pos == len(word):
                return True
            if (i, j) in tupleList:
                return False
            if i >= len(self.board) or i < 0 or j >= len(self.board[0]) or j < 0:
                return False
            if word[pos] != self.board[i][j]:
                return False
            newTupleList = tupleList[:] + [(i, j)]
            if self.checkWord(word, pos + 1, i + 1, j, newTupleList) or self.checkWord(word, pos + 1, i - 1, j,
                                                                                       newTupleList) \
                    or self.checkWord(word, pos + 1, i, j + 1, newTupleList) or self.checkWord(word, pos + 1, i, j - 1,
                                                                                               newTupleList):
                return True

