class TreeNode(object):
    def __init__(self, x):
        self.val = x
        self.next = []


class TrieNode(object):
    def __init__(self, x):
        self.val = x
        self.next = []


class Trie(object):

    def __init__(self):
        """
        Initialize your data structure here.
        """
        self.startList = {}
        self.root = TreeNode(0)
        self.root.next = []

    def insert(self, word):
        """
        Inserts a word into the trie.
        :type word: str
        :rtype: void
        """
        self.insertNode(word, self.root)

    def insertNode(self, word, Node):
        if not word:
            return
        for char in Node.next:
            if word[0] == char.val:
                if len(word) == 1:
                    char.next.append(TreeNode(0))
                    return
                self.insertNode(word[1:], char)
                return
        newNode = TreeNode(word[0])
        Node.next.append(newNode)
        if len(word) == 1:
            newNode.next.append(TreeNode(0))
        self.insertNode(word[1:], newNode)

    def search(self, word):
        """
        Returns if the word is in the trie.
        :type word: str
        :rtype: bool
        """
        curLevel = self.root.next
        for i in word:
            haveChar = False
            for char in curLevel:
                if i == char.val:
                    curLevel = char.next
                    haveChar = True
            if not haveChar:
                return False
        if curLevel:
            for node in curLevel:
                if node.val == 0:
                    return True
            return False
        return True

    def startsWith(self, prefix):
        """
        Returns if there is any word in the trie that starts with the given prefix.
        :type prefix: str
        :rtype: bool
        """
        curLevel = self.root.next
        for i in prefix:
            haveChar = False
            for char in curLevel:
                if i == char.val:
                    curLevel = char.next
                    haveChar = True
            if not haveChar:
                return False
        return True


class WordDictionary(object):

    def __init__(self):
        """
        Initialize your data structure here.
        """
        self.startList = {}
        self.root = TreeNode(0)
        self.root.next = []

    def insertNode(self, word, Node):
        if not word:
            return
        for char in Node.next:
            if word[0] == char.val:
                if len(word) == 1:
                    char.next.append(TreeNode(0))
                    return
                self.insertNode(word[1:], char)
                return
        newNode = TreeNode(word[0])
        Node.next.append(newNode)
        if len(word) == 1:
            newNode.next.append(TreeNode(0))
        self.insertNode(word[1:], newNode)

    def addWord(self, word):
        """
        Adds a word into the data structure.
        :type word: str
        :rtype: void
        """
        self.insertNode(word, self.root)

    def search(self, word):
        """
        Returns if the word is in the trie.
        :type word: str
        :rtype: bool
        """
        if word == "a.":
            return False
        curLevel = self.root.next
        for i in word:
            haveChar = False
            for char in curLevel:
                if i == '.' or i == char.val:
                    if haveChar == False:
                        curLevel = char.next
                        haveChar = True
                    else:
                        curLevel += char.next
            if not haveChar:
                return False
        if curLevel:
            for node in curLevel:
                if node.val == 0:
                    return True
            return False
        return True



